import butterfly from "../animals/butterfly.png";
import deer from "../animals/deer.png";
import fox from "../animals/fox.png";
import frog from "../animals/frog.png";
import hedgehog from "../animals/hedgehog.png";
import owl from "../animals/owl.png";
import pheasant from "../animals/pheasant.png";
import puffin from "../animals/puffin.png";
import robin from "../animals/robin.png";
import squirrel from "../animals/squirrel.png";

export default {
  butterfly,
  deer,
  fox,
  frog,
  hedgehog,
  owl,
  pheasant,
  puffin,
  robin,
  squirrel,
};
